func index(w http.ResponseWriter, r *http.Request) {
	p := &Page{Title: "测试标题", Body: []byte("测试内容"), Content: Gettxt(5000)}
	t, _ := template.ParseFiles("index.html")
	t.Execute(w, p)
}
func saveHandler(w http.ResponseWriter, r *http.Request) {
	fmt.Println("method:", r.Method)
}
func Gettxt(size int) template.HTML {
	rand.Seed(time.Now().UnixNano())
	rst := ""
	for i := 0; i < size; i++ {
		if i%10 == 0 {
			rst = rst + `mogupao<a href="http://127.0.0.1/` + strconv.Itoa(rand.Intn(50000)) + "/" + strconv.Itoa(rand.Intn(60000)) + `">` + txt[rand.Intn(5400)] + "</a>"
		} else {
			rst = rst + "mogupao" + txt[rand.Intn(5400)]
		}

	}
	return template.HTML(rst)
}
func Krand(size int, kind int) []byte {
	ikind, kinds, result := kind, [][]int{[]int{10, 48}, []int{26, 97}, []int{26, 65}}, make([]byte, size)
	is_all := kind > 2 || kind < 0
	rand.Seed(time.Now().UnixNano())
	for i := 0; i < size; i++ {
		if is_all {
			ikind = rand.Intn(3)
		}
		scope, base := kinds[ikind][0], kinds[ikind][1]
		result[i] = uint8(base + rand.Intn(scope))
	}
	return result
}
func main() {
	http.HandleFunc("/view/", viewHandler)
	http.HandleFunc("/edit/", editHandler)
	http.HandleFunc("/save/", editHandler)
	http.HandleFunc("/", index)
	http.ListenAndServe(":80", nil)
}
